import { useState } from "react";
import { useNavigate } from "react-router-dom"; // üëà importar
import axios from "axios";

function SolicitudAutonomos() {
  const [formData, setFormData] = useState({
    nombre: "",
    dni: "",
    direccionNegocio: "",
    direccionParticular: "",
    telefono: "",
    email: "",
    estadoCivil: "",
    regimenMatrimonial: "",
    importe: "",
    plazo: "",
    actividad: "",
    cnae: "",
  });

  const [message, setMessage] = useState("");
  const navigate = useNavigate(); // üëà inicializar

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const payload = {
        TITULAR: formData.nombre,
        NOMBRE: formData.nombre.split(" ")[0] || formData.nombre,
        APELLIDOS: formData.nombre.split(" ").slice(1).join(" ") || "",
        CIT: formData.dni,
        ACTIVIDAD: formData.actividad,
        COD_CNAE: formData.cnae,
        REGIMEN_ECONOMICO: formData.regimenMatrimonial,
        COD_DELEGACION: "001",
        TIPO_IDENTIDAD: "AUTONOMO",
        F_ALTA: new Date().toISOString().split("T")[0],
        F_CONSTITUCION: new Date().toISOString().split("T")[0],
        PAIS_NIF: "ES",
        COD_GESTOR: "WEB",
        VALIDEZ_DATOS: "S",
        PROCESO_ALTA: "WEB",
        EXPORTA: "N",
        NIVEL_COMPLETITUD: 0,
        CLASIF_PYME: "S",
        G3_BLOQUEO: "X",
        IDIOMA: "S",
      };

      console.log("üì§ Enviando payload:", payload);

      const res = await axios.post("http://127.0.0.1:5000/api/identidades", payload);

      if (res.status === 201) {
        setMessage("‚úÖ Solicitud creada con √©xito. REF_ID: " + res.data.REF_ID);

        // ‚è≥ esperar un poco para que el usuario vea el mensaje
        setTimeout(() => {
          navigate("/alta"); // üëà redirigir a AltasIdentidades
        }, 1500);
      } else {
        setMessage("‚ö†Ô∏è Algo raro pas√≥. C√≥digo: " + res.status);
      }
    } catch (err) {
      console.error("‚ùå Error en solicitud:", err);
      setMessage(
        "‚ùå Error: " +
          (err.response?.status || "") +
          " - " +
          (err.response?.data?.error || err.message)
      );
    }
  };

  return (
    <div style={{ maxWidth: "800px", margin: "0 auto" }}>
      <h2>Solicitud de Aval Aut√≥nomos</h2>
      <form onSubmit={handleSubmit}>
        {/* üëâ aqu√≠ van tus inputs como los tienes */}
        <label>
          Nombre y Apellidos:
          <input
            type="text"
            name="nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        {/* resto de inputs */}
        <button type="submit">Enviar Solicitud</button>
      </form>

      {message && <p>{message}</p>}
    </div>
  );
}

export default SolicitudAutonomos;
